Heading to St. Louis for the fabulous @stlartfair. This show is considered to be one of the top art fairs in the country. A show that is highly juried. So it’s an honor to be accepted. This show also had an amazing young artists mentoring program which I will be participating in by speaking on a panel about the Business of Art and mentoring a young artist. 
